import axios from 'axios';

class AuthService {
  constructor(baseURL) {
    this.client = axios.create({
      baseURL: baseURL,
      withCredentials: true,
      headers: {
        'Content-Type': 'application/json',
      },
    });
  }

  async signUp(email, password, name) {
    const data = this.client.post('/auth/signup', {
      email,
      password,
      name,
    });
    console.log(data);
  }

  async login(email, password) {
    const user = this.client.get('/auth/login', {
      email,
      password,
    });
    console.log(user);
  }
}

export default AuthService;
